import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { generateManagerCandidates } from '../data/managerData';

const ManagerSelectionModal = ({ setShowManagerSelection, onManagerSelect, leagueName }) => {
  const [selectedManager, setSelectedManager] = useState(null);
  const [managerCandidates] = useState(() => generateManagerCandidates(leagueName));

  const handleManagerSelect = () => {
    if (selectedManager) {
      onManagerSelect(selectedManager);
      setShowManagerSelection(false);
    }
  };

  const handleRejectAndWait = () => {
    // Yeni menajer adayları oluştur
    const newCandidates = generateManagerCandidates(leagueName);
    // Burada state'i güncellemek için bir callback gerekebilir
    // Şimdilik sadece modal'ı kapatıyoruz
    setShowManagerSelection(false);
  };

  const renderManagerCard = (manager) => (
    <div 
      key={manager.name}
      className={`fc-card ${selectedManager?.name === manager.name ? 'selected' : ''}`}
      onClick={() => setSelectedManager(manager)}
      style={{
        background: selectedManager?.name === manager.name ? 'var(--win)' : 'var(--green-light)',
        color: selectedManager?.name === manager.name ? '#fff' : 'var(--blue)',
        border: selectedManager?.name === manager.name ? '2px solid var(--win)' : '1px solid #ddd',
        cursor: 'pointer',
        transition: 'all 0.2s ease',
        padding: '15px',
        marginBottom: '10px'
      }}
    >
      <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
        {/* Avatar */}
        <div style={{
          width: '50px',
          height: '50px',
          borderRadius: '50%',
          background: '#4CAF50',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          fontSize: '20px',
          fontWeight: 'bold',
          color: '#fff'
        }}>
          {manager.name.split(' ')[0][0]}
        </div>
        
        {/* Manager Info */}
        <div style={{ flex: 1 }}>
          <div style={{ 
            fontWeight: 'bold', 
            fontSize: '16px',
            marginBottom: '8px'
          }}>
            {manager.name}
          </div>
          
          {/* Attributes */}
          <div style={{ display: 'flex', gap: '8px', marginBottom: '8px' }}>
            <span style={{
              background: '#4CAF50',
              color: '#fff',
              padding: '2px 6px',
              borderRadius: '4px',
              fontSize: '12px',
              fontWeight: 'bold'
            }}>
              M {manager.management}
            </span>
            <span style={{
              background: '#4CAF50',
              color: '#fff',
              padding: '2px 6px',
              borderRadius: '4px',
              fontSize: '12px',
              fontWeight: 'bold'
            }}>
              A {manager.attacking}
            </span>
            <span style={{
              background: '#4CAF50',
              color: '#fff',
              padding: '2px 6px',
              borderRadius: '4px',
              fontSize: '12px',
              fontWeight: 'bold'
            }}>
              T {manager.tactical}
            </span>
          </div>
          
          {/* Tactic */}
          <div style={{ fontSize: '14px', marginBottom: '4px' }}>
            {manager.tactic}
          </div>
          
          {/* Fan Support */}
          <div style={{ fontSize: '14px', marginBottom: '4px' }}>
            Taraftarlar: {manager.fanSupport}
          </div>
          
          {/* Compensation */}
          <div style={{ fontSize: '14px' }}>
            Tazminat Ödemesi: {manager.compensation > 0 ? `£${manager.compensation}k` : 'Yok'}
          </div>
        </div>
      </div>
    </div>
  );

  return (
    <div className="fc-modal-backdrop">
      <div className="fc-modal" style={{ maxWidth: '600px', maxHeight: '80vh', overflow: 'auto' }}>
        <h3>BİR MENAJER KİRALA</h3>
        
        <div className="fc-panel">
          <h4 style={{ margin: '0 0 15px 0', textAlign: 'center' }}>
            Menajer Adayları
          </h4>
          <div style={{
            maxHeight: '400px',
            overflowY: 'auto'
          }}>
            {managerCandidates.map(renderManagerCard)}
          </div>
        </div>
        
        <div className="fc-footerbar" style={{ marginTop: '20px' }}>
          <button
            className="fc-btn"
            onClick={handleManagerSelect}
            disabled={!selectedManager}
            style={{
              background: selectedManager ? 'var(--win)' : '#ccc',
              flex: 1,
              marginRight: '10px'
            }}
          >
            Menajeri Seç
          </button>
          <button
            className="fc-btn"
            onClick={handleRejectAndWait}
            style={{
              background: 'var(--green)',
              flex: 1
            }}
          >
            Reddet ve daha fazla aday bekle
          </button>
        </div>
      </div>
    </div>
  );
};

ManagerSelectionModal.propTypes = {
  setShowManagerSelection: PropTypes.func.isRequired,
  onManagerSelect: PropTypes.func.isRequired,
  leagueName: PropTypes.string.isRequired,
};

export default ManagerSelectionModal;
